import React from 'react';

export default function ListPage() {
  return (
    <div>
      <video width="100%" height="auto" controls>
        <source src="https://youtu.be/R_IeYv6BGXk" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
}
